import React, { useEffect, useState } from "react";

function Content({ response }) {
  var content = null;
  if (response) {
    content = response.status;
    console.log(response);
  } else {
    content = <p>Ohter sutff</p>;
  }

  return <p>{content}</p>;
}

export default Content;
